var game = new Phaser.Game(800, 321, Phaser.AUTO, 'gameContainer', {  preload: preload, create: create, update: update, render: render  });
 
function preload() {
  
      game.load.image('background', 'data:image/png;base64,');

 //game.load.spritesheet('Squid', 'data:image/png;base64,', 80, 64, 12); 
  
  
  game.load.spritesheet('TombZombies', 'data:image/png;base64,', 32, 32, 96);
  //game.load.spritesheet('explosion', '//i.imgur.com/9buBDy1.png', 192,195);
}
                        
var player;
var facing = 'left';
var jumpTimer = 0;
var cursors;
var jumpButton;
var bg;
var emitter;                      
var enemy1;
var enemy2;
var enemy3;
var score = 0;
var scoreText;
 
function create() {
   
          // Stretch to fill
    //game.scale.fullScreenScaleMode = Phaser.ScaleManager.EXACT_FIT;

    // Keep original size
    // game.scale.fullScreenScaleMode = Phaser.ScaleManager.NO_SCALE;

    // Maintain aspect ratio
    game.scale.fullScreenScaleMode = Phaser.ScaleManager.SHOW_ALL; 
    game.input.onDown.add(gofull, this);
    game.physics.startSystem(Phaser.Physics.ARCADE);
    bg = game.add.tileSprite(0, 0, 800, 321, 'background');

    game.physics.arcade.gravity.y = 450;    
    
    scoreText = game.add.text(16, 16, 'score: 0', { fontSize: '32px', fill: '#000' });
    
        
    player = game.add.sprite(100, 110, 'TombZombies', 1);
    enemy1 = game.add.sprite(600, 110, 'TombZombies', 10);
   // enemy2 = game.add.sprite(700, 110, 'squid', 1);
     

    game.physics.enable(player, Phaser.Physics.ARCADE);
    game.physics.enable(enemy1, Phaser.Physics.ARCADE);
  //game.physics.enable(enemy2, Phaser.Physics.ARCADE);

    enemy1.body.bounce.y = 0.2;
    enemy1.body.collideWorldBounds = true;
    enemy1.body.setSize(20, 31, 6, 3);
 

   //enemy2.body.bounce.y = 0.4;
   // enemy2.body.collideWorldBounds = true;
    //enemy2.body.setSize(20, 31, 6, 3);
      
        
    player.body.bounce.y = 0.2;
    player.body.collideWorldBounds = true;
    player.body.setSize(20, 31, 6, 3);
              
 player.animations.add('zombiewalkl',[12,13,14],8,true);
 player.animations.add('zombiewalkr',[24,25,26],8,true);
        
 enemy1.animations.add('skell',[21,22,23],8,true);
 enemy1.animations.add('skelr',[33,34,35],8,true);
 
 //enemy2.animations.add('squidl',[3,4,5],8,true);
 //enemy2.animations.add('squidr',[6,7,8],8,true);
 

 player.health = 50;   // simple as that really.
 //player.scale.x = 1.5; // set the size/scale of the width
 //player.scale.y = 1.5; // same for the height of the player
        
 cursors = game.input.keyboard.createCursorKeys();
 jumpButton = game.input.keyboard.addKey(Phaser.Keyboard.SPACEBAR);         
 }
 
  
function gofull() {

    if (game.scale.isFullScreen)
    {
        game.scale.stopFullScreen();
    }
    else
    {
        game.scale.startFullScreen();
    }

}  
  
 function hurtmePlenty (player, enemy1) {
    
    // Removes the star from the screen
    player.kill();
    enemy1.frame = 10;
    //  Add and update the score
    score -= 10;
    scoreText.text = 'Score: ' + score;

} 
  
  function collectStar (player, star) {
    
    // Removes the star from the screen
    star.kill();

    //  Add and update the score
    score += 10;
    scoreText.text = 'Score: ' + score;

}
  
  
function update() {
  
// game.physics.arcade.collide(player, layer);

   player.body.velocity.x = 0;
   enemy1.body.velocity.x = 0;
   //enemy2.body.velocity.x = 0;
  
  
  // if (game.input.activePointer.x < player.x) {
    // mouse pointer is to the left
 // }
 // else {
    // mouse pointer is to the right
 // }
  
  
if //(game.input.activePointer.x < player.x )
   (cursors.left.isDown)
    {
        player.body.velocity.x = -150;

        if (facing != 'left')
        {
            player.animations.play('zombiewalkl');
            facing = 'left';
        }
    }
    else if 
      
      //(game.input.activePointer.x > player.x)  
      (cursors.right.isDown)
    {
        player.body.velocity.x = 150;

        if (facing != 'right')
        {
            player.animations.play('zombiewalkr');
            facing = 'right';
        }
    }
    else
    {
        if (facing != 'idle')
        {
            player.animations.stop();

            if (facing == 'left')
            {
                player.frame = 0;
            }
            else
            {
                player.frame = 0; //5
            }

            facing = 'idle';
        }
    }
    
    if (jumpButton.isDown && player.body.onFloor() && game.time.now > jumpTimer)
    {
        player.body.velocity.y = -350;
        jumpTimer = game.time.now + 750;
    }
  
  
  
  //(game.input.activePointer.x > player.x) 
   if (player.x < enemy1.x - 32) {
   enemy1.animations.play('skell');
   enemy1.body.velocity.x = -50;
 }
 else if (player.x > enemy1.x + 32) {
   enemy1.animations.play('skelr');
   enemy1.body.velocity.x = 50;
   
 }
  
  else {
    enemy1.body.velocity.x = 0;
    enemy1.frame = 10;
  }
  
   //enemy2.animations.play('squidl');
  
  //enemy got me!
game.physics.arcade.overlap(player, enemy1, hurtmePlenty, null, this);
  //bonuses
  //game.physics.arcade.overlap(player, stars, collectStar, null, this);

}
  

  function render () {

     game.debug.text(game.time.physicsElapsed, 14, 22);
     //game.debug.body(player);
     game.debug.bodyInfo(player, 14, 44);
    
    game.debug.text('Click / Tap to go fullscreen', 270, 16);

}
